import React, { useState } from "react";
import SearchBar from './SearchBar';
import axios from 'axios';


const App =()=>{

    const [textApp , setTextApp] = useState('nature')

    const Api = async () =>{
        const response = await axios.get("https://api.unsplash.com/search/photos",{
            headers:{Authorization: "Client-ID vTYLIbUn1xMRuuOvyRLXxrLMKMnut8mklGChYcWXTxM"},
            params:{query : textApp}
        })

    }

    return (
        <div>
            <SearchBar setTextApp={setTextApp} Api={Api}/>
            
        </div>
    );
}
export default App;
